import React from 'react';

const Tile = ({ onClick, isOpen, id }) => {
    return (
        <div className={`tile ${isOpen ? "open" : "closed"}`} onClick={() => onClick(id)}>
            {isOpen ? id : "?"}
        </div>
    );
};

export default Tile;
